package fyne

import (
	"encoding/base64"
	"fmt"
	"time"

	"fyne.io/fyne/v2"
	"fyne.io/fyne/v2/canvas"
	"fyne.io/fyne/v2/container"
	"fyne.io/fyne/v2/widget"

	"github.com/wenchezhao/EyeCare/config"
)

var alipayIcon = ``
var wechatIcon = ``

func ShowFullScreenPopup(a fyne.App, cfg *config.Config) {
	var pop fyne.Window
	fyne.CurrentApp().Driver().DoFromGoroutine(func() {
		pop = a.NewWindow("休息提醒")
		pop.SetFullScreen(true)
		pop.RequestFocus()
	}, false)

	done := make(chan bool)
	// 创建按钮和计时器标签
	countdownLabel := widget.NewLabel("")
	noButton := widget.NewButton("提前退出", func() {
		pop.Close()
	})

	// 创建按钮容器并居中
	buttons := container.NewCenter(container.NewHBox(noButton))
	// 创建标签容器并居中
	labelContainer := container.NewCenter(countdownLabel)

	// 创建垂直布局并居中所有元素
	content := container.NewCenter(
		container.NewVBox(
			labelContainer,
			buttons,
		),
	)

	go func() {
		for i := cfg.RestDuration; i >= 0; i-- {
			fyne.CurrentApp().Driver().DoFromGoroutine(func() {
				countdownLabel.SetText(fmt.Sprintf("请远眺20英尺（约6米）休息，还剩 %d 秒", i))
				pop.RequestFocus()
			}, false)
			time.Sleep(1 * time.Second)
			// 检查是否已经被提前关闭
			select {
			case <-done:
				return
			default:
			}
		}
		close(done)
	}()
	noButton.OnTapped = func() {
		defer close(done)
	}
	fyne.CurrentApp().Driver().DoFromGoroutine(func() {
		pop.SetContent(content)
		pop.Show()
		pop.RequestFocus()
	}, false)
	// 等待结束
	<-done
	fyne.CurrentApp().Driver().DoFromGoroutine(func() {
		pop.Close()
	}, false)

}

var versionWin fyne.Window // 全局变量，保存版本窗口

func showVersionInfo(a fyne.App, iconR *fyne.StaticResource) {
	if versionWin != nil {
		versionWin.Show()
		versionWin.RequestFocus()
		return
	}

	versionWin = a.NewWindow("版本信息")

	// 背景图片
	bg := canvas.NewImageFromResource(iconR)
	bg.FillMode = canvas.ImageFillStretch // 拉伸填满窗口

	// 前景内容
	countdownLabel := widget.NewLabel("EyeCare 版本 v1.0.0\n作者: 非秃头程序员\n")
	content := container.NewCenter(countdownLabel)

	// 叠加容器：把背景图放在最底层，内容放在上层
	mainContainer := container.NewMax(bg, content)

	versionWin.SetContent(mainContainer)
	versionWin.Resize(fyne.NewSize(300, 150))
	versionWin.CenterOnScreen()

	versionWin.SetCloseIntercept(func() {
		versionWin.Close()
		versionWin = nil
	})

	versionWin.Show()
}

func ShowVersionInfo(a fyne.App) {
	if versionWin != nil {
		versionWin.Show()
		versionWin.RequestFocus()
		return
	}

	versionWin = a.NewWindow("版本信息")

	// 背景图片
	bg := canvas.NewImageFromFile("icon.ico")
	bg.FillMode = canvas.ImageFillStretch // 拉伸填满窗口

	titleLabel := widget.NewLabel("EyeCare 版本 v1.0.0\n作者: 非秃头程序员\n")

	aliByteIcon, err := base64.StdEncoding.DecodeString(alipayIcon)
	if err != nil {
		panic(err)
	}
	aliQR := canvas.NewImageFromResource(fyne.NewStaticResource("aliQR", aliByteIcon))
	aliQR.FillMode = canvas.ImageFillContain
	aliQR.SetMinSize(fyne.NewSize(120, 120))
	aliBlock := container.NewVBox(
		container.NewCenter(aliQR),
		container.NewCenter(widget.NewLabel("支付宝")),
	)

	wechatByteIcon, err := base64.StdEncoding.DecodeString(wechatIcon)
	if err != nil {
		panic(err)
	}
	wxQR := canvas.NewImageFromResource(fyne.NewStaticResource("aliQR", wechatByteIcon))
	wxQR.FillMode = canvas.ImageFillContain
	wxQR.SetMinSize(fyne.NewSize(120, 120))
	wxBlock := container.NewVBox(
		container.NewCenter(wxQR),
		container.NewCenter(widget.NewLabel("微信")),
	)

	// 横向并排显示两个二维码块
	qrRow := container.NewHBox(
		container.NewCenter(aliBlock),
		container.NewCenter(wxBlock),
	)

	// 在二维码上方加“赞赏”标题和分隔线
	rewardSection := container.NewVBox(
		widget.NewSeparator(),
		container.NewCenter(widget.NewLabel("赞赏")),
		qrRow,
	)

	// 总体垂直布局：版本信息在上，赞赏区在下
	content := container.NewVBox(
		titleLabel,
		rewardSection,
	)

	// 居中放置所有内容
	centerContent := container.NewCenter(content)

	// 叠加容器：背景图在底层，内容在上层
	mainContainer := container.NewMax(bg, centerContent)

	versionWin.SetContent(mainContainer)
	versionWin.Resize(fyne.NewSize(300, 150)) // 调整窗口大小
	versionWin.CenterOnScreen()

	versionWin.SetCloseIntercept(func() {
		versionWin.Close()
		versionWin = nil
	})

	versionWin.Show()
}
